import React from "react";


export default class Bill extends React.Component {
    render() {
        let summary = this.props.summary.map(item => {
            return (
                <div>
                    <h4>{item.fishname}</h4>
                    <p>
                    {item.order}</p>
                </div>
            );
        })
        return (
            <div>
                <h1>Bill</h1>
                {summary}
            </div>
        );
    }
}
